September 17, 2010

Monique hosts a PTA meeting in her home with some of her fellow Moms and Scott, who's sitting in for his &quot;baby's mama.&quot; The ladies get into a heated argument over school uniforms for their daughters, especially when Monique brings out a sample of what she feels is appropriate. Scott, meanwhile, couldn't care less as he's absolutely enthralled by Moniqiue's cookies. When the gals storm out of the meeting, Monique decides to try the uniform on and give Scott a taste of a different kind of cookie.

